import React, { useState, useEffect } from 'react';
import DataList from '../components/DataList';
import { fetchData } from '../services/api';

const Home = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetchData().then((response) => setData(response));
  }, []);

  return (
    <div>
      {data ? (
        <DataList data={data} />
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );
};

export default Home;
